import React, { Component } from 'react';
//import './App.css'; /* optional for styling like the :hover pseudo-class */
import StateParks from '../pages/StateParks';

//Material UI
import Typography from '@material-ui/core/Typography';
import Link from '@material-ui/core/Link';
import USAMap from "react-usa-map";

class Map extends Component {
  mapHandler = (event) => {
    var targetId = event.target.dataset.name;
	  //var targetId = {value: event.target.dataset.name};
  };
  render() {
    return (
      <div className="App">
	<Link  color="inherit" href='/StateParks/'>
        <USAMap onClick={this.mapHandler} />
	</Link>
      </div>
    );
  }
}

export default Map;
export const targetId= event.target.dataset.name;
